window.bookSummaryJSON = "<p>David Tennant, Catherine Tate and Michelle Ryan read this exclusive collection of original audio adventures. Join the Tenth Doctor on these seven adventures in time and space, written specially for audio. </p> <p>'Pest Control' by Peter Anghelides - read by David Tennant. The Doctor and Donna face monstrous insects and a ruthless robot exterminator. </p> <p>'The Forever Trap' by Dan Abnett - read by Catherine Tate. On the Edifice, the Doctor and Donna become neighbours to a terrifying assortment of aliens. </p> <p>'The Nemonite Invasion' by David Roden - read by Catherine Tate. The Doctor and Donna fight for their lives against aliens in the Second World War. </p> <p>'The Rising Night' by Scott Handcock- read by Michelle Ryan. The Doctor is plunged into a nightmarish adventure in 18th century Yorkshire. </p> <p>'The Day of the Troll' by Simon Messingham - read by David Tennant. In a barren England of the far future, something is preying on people - and the Doctor.... </p> <p>'The Last Voyage' by Dan Abnett - read by David Tennant. Terror ensues when the Doctor joins the maiden voyage of a pioneering space cruiser. </p> <p>'Dead Air' by James Goss - read by David Tennant. The Doctor faces an enemy of pure sound. Who can he trust in the dark? </p> <p>With thrilling music and sound design, these seven adventures are based on the hit BBC TV series. </p> <p>Duration: 13 hours approx. </p>"; 
